import React from 'react';
import VideoItem from './VideoItem';

// const VideoList = props =>{

//     return(<div>{props.videos.length}</div>);
// }

//or the same as above
const VideoList = ({videos}) =>{

    videos.map(video =>{
        return(<VideoItem/>);
    });

    return(
    <div>{videos.length}</div>
    // <VideoItem />
    );
}

export default VideoList;
